import { createIcon } from "../icon/createIcon";

export const ClockSolidIcon = createIcon(
  <svg viewBox="0 0 12 12" data-testid="ClockSolidIcon">
    <path d="M7 7H3V6h3V3h1v4zM0 6a6 6 0 1 0 12 0A6 6 0 0 0 0 6z" />
  </svg>,
  "ClockSolid",
  "clock solid"
);
